      zIndex: '25',
    };

  return (
    <>
      <div className="container">
        <nav>
          <div className="logo">
            <img src={logo} alt="Logo" />
          </div>
          <ul>
            <li className='li'>Home</li>
            <li className='li'>About Us</li>
            <li className='li'>Our Services</li>
            <li className='li'>Testimonials</li>
            <li className='li'>Blogs</li>
            <li className='li'>Dropdown <span></span></li>
            <li className='li'>Contact</li>
          </ul>
        </nav>

        <div className="img-slider">
          <svg onClick={slideLeft} width="36" height="36" fill="currentColor" className="bi bi-arrow-left-short" viewBox="0 0 16 16">
  <path fill-rule="evenodd" d="M12 8a.5.5 0 0 1-.5.5H5.707l2.147 2.146a.5.5 0 0 1-.708.708l-3-3a.5.5 0 0 1 0-.708l3-3a.5.5 0 1 1 .708.708L5.707 7.5H11.5a.5.5 0 0 1 .5.5"/>
</svg>
<svg onClick={slideRight} width="36" height="36" fill="currentColor" className="bi bi-arrow-right-short" viewBox="0 0 16 16">
