              <img key={index} src={img} alt="Slide" style={{ width: '100vw', flexShrink: 0 }} />

          </div>
     ))}
     <h1 style={{position:'absolute',left:'25%',top:'35%',zIndex:'23',}}>Farming is the best solution of <br /> worlds starvation</h1>
     <h1 style={text1} >Organic vegetables is good for <br /> health</h1>
     <h1 style={text2} >Providing Fresh Produce Every Single Day</h1>
     <h1 style={text3} >Farming as a Passione</h1>
     <h1 style={text4} >Good Food For All</h1>
     <p style={paragraph1}>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nobis explicabo magni quia ipsa enim commodi praesentium nisi ab dolorum itaque!</p>
